package com.janbask.breakcontinueKeyword;
public class Break_Continue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		for( int i=0; i< 15; i++) {
			
			if( i==6)
			
				
			continue;
			
			
			if(i==10)
			
				break;
			
			System.out.println(i);
			
			}
			
		}

	}


